import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaPaw, FaUser, FaTruck, FaStethoscope, FaHome } from 'react-icons/fa';
import './MainDashboard.css';

const MainDashboard = () => {
    const navigate = useNavigate();

    const sections = [
        { title: "Pet Management", icon: <FaPaw />, path: "petManage" },
        { title: "Adopter Management", icon: <FaUser />, path: "adopter" },
        { title: "Distributor Management", icon: <FaTruck />, path: "distributorManage" },
        { title: "Vet Management", icon: <FaStethoscope />, path: "vet" },
        { title: "Daycare Management", icon: <FaHome />, path: "daycareManage" },
    ];

    return (
        <div className="admin-dashboard">
            {sections.map((section, index) => (
                <div className="admin-card" key={index}>
                    <div className="icon-container">{section.icon}</div>
                    <h3>{section.title}</h3>
                    <div className="button-group">
                        <button className="admin-button" onClick={() => navigate(`/${section.path}/add`)}>Add</button>
                        <button className="admin-button" onClick={() => navigate(`/${section.path}/update`)}>Update</button>
                        <button className="admin-button" onClick={() => navigate(`/${section.path}/delete`)}>Delete</button>
                        <button className="admin-button" onClick={() => navigate(`/${section.path}/find`)}>Find</button>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default MainDashboard;
